import React from 'react';
import DrawerToggle from '../SideDrawer/DrawerToggle';
import DotsToggle from './DotsToggle';
import './Toolbar.css';

const Toolbar = props => {
    return (
        <header className="toolbar">
            <nav className="toolbar-navigation">
                <DrawerToggle click={props.toggleDrawer} />
                <div className="toolbar-logo" onClick={props.clickDash}>kralco</div>
                <div className="nav-item" onClick={props.sendCoins}>Send Coins</div>
                <div className="nav-item" onClick={props.receiveCoins}>Buy Coins</div>
                <div className="nav-item" onClick={props.changeWallet}>Wallets</div>
                <div className="nav-item" onClick={props.changeNetwork}>Networks</div>
                <DotsToggle click={props.toggleDropMenu} />
            </nav>
        </header>
    )
}

export default Toolbar;
